Check out this awesome photo I took at @footprintsrunning this year. 

I often feel that I lack the confidence to do a great job leading an organization like this, but people keep coming back. It’s because Footprints isn’t about any one person; it’s about all of us. With the help of amazing people like @natebender10 @mariavallejo1990 @a_carruthless and many more, we’re creating some really cool new opportunities for runners around the world to engage with climate action. And have fun running too! Tell me: if you came to camp, what would you like to learn and/or work on? 

