#runfootprints

@footprintsrunning helps regular people do amazing things. Climate change is so scary, but Footprints is proof that you don’t have to have all the skills and degrees and resources: you just have to try. Our goal is to empower everyone to use the skills and connections they already have to make whatever difference they can, and it’s amazing to see people learn to believe in themselves.

This year we’re hosting 3 camps in 2 countries and bringing resources to people everywhere even if they can’t come to a camp. Join us and be part of something that feels good AND makes a difference. 

Special thanks to @maxromey for making an incredible trailer and to @natebender10 for being the best business partner a guy could ask for. I couldn’t do it without you. 

