I got to run the Gorge Waterfalls 50km this weekend. My first race since October and I went out hard like a super awesome pro and then totally blew up like a super awesome pro. But I pushed hard the whole way and did my best and got to watch a lot of stronger guys like @dylanhumberger and @mattdaniels480 and @r_beckz run super well and push each other. It felt amazing to be back among this community of trail runners. There’s something different about this group that I can’t explain but which has kept me coming back for a decade and a half. 

That’s actually a major reason I did this race: @runfreetrail partnered with @daybreakracing to put the race on, and we’ve been working with Freetrail at @footprintsrunning to try to use this running community for good. They build such strong connections between people and bring out the best in all of us. Watching @dylanbo standing in the rain for endless hours to cheer on every finisher and seeing @ryanthrower sprinting up and down hills to capture the stories was a look into the gritty behind-the-scenes that makes their accomplishments possible. We’re really lucky to have this new force in our sport preserving the values of community while embracing competition. 

If you get the chance to run a Daybreak race, don’t miss it: they’re amazing. Even if you’re not as prepared as you want and run like an idiot, you’ll still have a great time. I’m filled up with so much good feeling and energy after this weekend, can’t wait to get back to work for the next one!

