Two weeks from today I’ll be trading my spikes out for…well, just normal running shoes, I guess (ha ha, I mean NNormal running shoes) because I’ll be racing across the whole island of La Palma at Transvulcania. It’s a 75km race in the Canary Islands! This has been a busy winter for me and my running has been inconsistent through a lot of it, but I’ve been training quite well the last few weeks and I’m really looking forward to going back to a race I’ve done 3(!) times before in such a unique place. It’s always competitive and I’ll do my best, but it feels more like an opportunity to see a lot of old friends. Crazy to think the first time I went to La Palma was 2012; I’m grateful to have the health and strength to still run hard over a decade later! Now I just need to motivate for the last few hard runs. 

