Trading out the bike shoes tomorrow for running shoes. I biked here to raise money for @footprintsrunning and the fundraiser continues through the race: we’re looking to raise $20k to support our campers’ climate projects year-round. Who’s with me? Join the drive, share with your friends, and get involved with climate action now!

100 miles from Palisades to Auburn at @wser - a historic event I’ve always wanted to be a part of. After years of watching and being inspired, it’s finally my chance to take part in this wonderful event. I’m going to run hard and enjoy the experience, whatever that turns out to be. I’m genuinely excited for this, truly happy for this opportunity. See you on the other side!

