I gave it everything I had on Saturday. That turned out to be a 100 mile run through the Sierra Nevada in 17 hours. I feel extremely proud and grateful. 

The first 2/3 of my race went one way and I had the opportunity to watch @tomevansultra execute perfectly. He was strong, consistent, and positive all day. I don’t know if I’ve ever worked so well with another runner during a race, but that might have been because he was so clearly stronger than me and I needed him to bring me along. The last 1/3 went a different way, but it gave me the opportunity to see a lot of other runners moving towards their goals. I got to talk to the aid station volunteers more. @ptcruisin22 paced me for the last 20 miles and thank goodness because I really needed some help. 

There were some incredible performances, but @courtneydauwalter deserves special credit for her run. Courtney is one of the greatest athletes our sport has ever seen and she continues to impress us with not only her running but her humility and generosity every day. She caught me with my pants down (literally, it was kind of funny) and I felt lucky to get to witness such a virtuoso performance. 

This race is amazing. All these people running, watching, helping, cheering. These mountains. These trails. The history. I got to be a part of something really special this weekend that’s hard to put into words. 

I couldn’t have done this alone. Thank you for the million messages and cheers and high fives and everything else. I’m feeling so lucky. 

