How did I get home? I took a train!

I love bike touring and my trip to @wser was amazing. But if we want to create climate solutions that scale up for all people, we need to invest in better public infrastructure. Airplanes are inefficient, but trains have the potential to meet all our domestic travel needs. I wanted this trip to encompass a travel solution that’s not only accessible to people like me with enough time and money to ride their bikes a long way. 

This trip has been spectacular. The fundraiser has been hugely successful thanks to your incredible support. I’m taking a few days at home to rest and reflect on how grateful I am to be part of such a great sport. You’ve helped me accomplish so many goals, and I’m fired up to keep working and dreaming and scheming. See you at the next one!

